import React from 'react'
import './Slider.css'
import Background from '../images/pexels-felipe.jpg'


function Slider() {
    return (
        <div className="lander">
            <img src="https://media.istockphoto.com/photos/necklace-made-with-small-pearls-over-a-white-background-picture-id182386558?b=1&k=20&m=182386558&s=170667a&w=0&h=9T8e-tHtC5FdcZfWvwEWBK0nMuww58acHyGTfDvVHcI=" className="image"></img>

        </div>
    )
}

export default Slider
